import './HeaderCss.js';
import { HeaderWrap } from './HeaderCss.js';

function Header() {
  return (
    <HeaderWrap>
        <Logo src={require('../../images/LogoWhite.png')}/>
        <SearchBox/>
        <SearchSimbol src={require('../../images/searchSimbol.png')}/>
    </HeaderWrap>
  );
}

export default Header;
